import{_ as e,o as l,c as i,a as t}from"./app.afe75d95.js";var a="/TIL/assets/TDD.001.1bf7ffa5.jpeg",o="/TIL/assets/TDD.002.f39e9a2b.jpeg",r="/TIL/assets/TDD.003.5206d1fb.jpeg";const p={},s=t('<h1 id="tdd-overview" tabindex="-1"><a class="header-anchor" href="#tdd-overview" aria-hidden="true">#</a> TDD Overview</h1><hr><blockquote><p>Test-Driven Development \uD14C\uC2A4\uD2B8\uAC00 \uAC1C\uBC1C\uC744 \uC774\uB04C\uC5B4\uB098\uAC04\uB2E4.</p></blockquote><p>\uB9E4\uC6B0 \uC9E7\uC740 \uAC1C\uBC1C \uC0AC\uC774\uD074\uC744 \uBC18\uBCF5\uD558\uB294 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C \uD504\uB85C\uC138\uC2A4 \uC911 \uD558\uB098. \uD504\uB85C\uC81D\uD2B8\uB97C \uAC1C\uBC1C\uD558\uB294 \uACFC\uC815\uC5D0\uC11C \uAE30\uB2A5 \uAC1C\uBC1C\uBCF4\uB2E4 \uD14C\uC2A4\uD2B8 \uC791\uC131\uC744 \uC6B0\uC120\uC2DC\uD558\uACE0, \uC774\uB7EC\uD55C \uD14C\uC2A4\uD2B8 \uCF54\uB4DC\uC758 \uBC18\uBCF5\uC73C\uB85C \uAE30\uB2A5\uC758 \uC815\uC0C1\uC801\uC778 \uB3D9\uC791 \uC5EC\uBD80 \uD53C\uB4DC\uBC31\uC744 \uC801\uADF9\uC801\uC73C\uB85C \uBC1B\uB294 \uAC83.</p><p><img src="'+a+'" alt="Comparison"></p><h2 id="\u110C\u1161\u11BC\u110C\u1165\u11B7" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u11BC\u110C\u1165\u11B7" aria-hidden="true">#</a> \uC7A5\uC810</h2><ul><li><p>\uAC1D\uCCB4\uC9C0\uD5A5\uC801 (Object-oriented) \uCF54\uB4DC \uAC1C\uBC1C</p><ul><li>\uBA85\uD655\uD55C \uAE30\uB2A5\uACFC \uAD6C\uC870\uB97C \uC124\uACC4\uD560 \uC218 \uC788\uB2E4.</li><li>\uAC01 \uD568\uC218\uC640 \uAE30\uB2A5\uC5D0 \uB300\uD574 \uCCA0\uC800\uD788 \uAD6C\uC870\uD654\uD558\uC5EC \uCF54\uB4DC \uC791\uC131\uC774 \uAC00\uB2A5\uD558\uB2E4. --&gt; \uD14C\uC2A4\uD2B8 \uC6A9\uC774\uC131\uC744 \uC704\uD55C \uBCF5\uC7A1\uD55C \uAE30\uB2A5\uC744 \uD55C \uD568\uC218\uC5D0 \uBAA8\uB450 \uAD6C\uD604\uD558\uBA74 \uD14C\uC2A4\uD2B8 \uBC29\uC2DD\uC774 \uBCF5\uC7A1\uD574\uC9C0\uACE0 \uC624\uB798 \uAC78\uB9AC\uBA70, \uCF54\uB4DC \uC218\uC815 \uC2DC \uD14C\uC2A4\uD2B8 \uCF54\uB4DC\uC758 \uC7AC\uC0AC\uC6A9\uC774 \uC5B4\uB835\uAE30 \uB54C\uBB38 --&gt; \uBAA8\uB4E0 \uCF54\uB4DC\uAC00 \uC7AC\uC0AC\uC6A9\uC131\uC744 \uBC14\uD0D5\uC73C\uB85C \uC791\uC131\uB418\uC5B4\uC57C\uD558\uAE30 \uB54C\uBB38\uC5D0 \uBCF4\uB2E4 <code>\uAC1D\uCCB4\uC9C0\uD5A5</code>\uC801\uC778 \uCF54\uB4DC\uAC00 \uB428</li></ul></li><li><p>\uC124\uACC4 \uC218\uC815 \uC2DC\uAC04\uC758 \uB2E8\uCD95</p><ul><li>\uD14C\uC2A4\uD2B8 \uCF54\uB4DC\uAC00 \uBA3C\uC800 \uC791\uC131\uB418\uAE30 \uB54C\uBB38\uC5D0, \uCD5C\uCD08\uC758 \uC124\uACC4\uB97C \uB9CC\uC871\uD558\uBA70 \uC785\uCD9C\uB825 \uAD6C\uC870\uC640 \uAE30\uB2A5\uC758 \uC815\uC758\uB97C \uBA85\uD655\uD788 \uD558\uBBC0\uB85C \uC124\uACC4\uC758 \uAD6C\uC870\uC801 \uBB38\uC81C\uB97C \uD30C\uC545\uD560 \uC218 \uC787\uC74C.</li><li>\uACB0\uD568\uC744 \uC77C\uCC0D \uD30C\uC545\uD560 \uC218\uB85D \uC218\uC815\uC5D0 \uD544\uC694\uD55C \uAE30\uB300\uBE44\uC6A9\uC774 \uAC10\uCD95\uB41C\uB2E4.</li></ul><p><img src="'+o+'" alt="Cost"></p></li><li><p>\uB514\uBC84\uAE45 \uC2DC\uAC04 \uB2E8\uCD95</p><ul><li>\uB2E8\uC704 \uD14C\uC2A4\uD2B8 \uAE30\uBC18\uC758 \uD14C\uC2A4\uD2B8 \uCF54\uB4DC \uC791\uC131\uC740 \uD5A5\uD6C4 \uBB38\uC81C \uBC1C\uC0DD \uC2DC \uBB38\uC81C\uC758 \uC9C0\uC810\uC744 \uC27D\uAC8C \uD30C\uC545 \uAC00\uB2A5</li></ul><blockquote><p>\uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD560 \uC218 \uC788\uB294 \uC9C0\uC810\uC740 \uB370\uC774\uD130\uBCA0\uC774\uC2A4 \uC601\uC5ED, \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uC601\uC5ED, \uB370\uC774\uD130 \uC601\uC5ED, \uBA54\uBAA8\uB9AC \uC601\uC5ED \uB4F1 \uB2E4\uC591\uD558\uAE30 \uB54C\uBB38\uC5D0 \uD1B5\uD569 \uD14C\uC2A4\uD2B8\uB294 \uBB38\uC81C\uC758 \uC9C0\uC810\uC744 \uD30C\uC545\uD558\uB294 \uB370 \uC5B4\uB824\uC6B4 \uC694\uC18C\uB85C \uC791\uC6A9\uD568</p></blockquote><p><img src="'+r+'" alt="Cycle"></p></li><li><p>\uC720\uC9C0\uBCF4\uC218 \uC6A9\uC774\uC131</p><ul><li>\uD14C\uC2A4\uD2B8 \uC694\uC18C\uAC00 \uAE30\uC220\uC801 \uAD00\uC810\uC774 \uC544\uB2CC \uC0AC\uC6A9\uC790 \uAD00\uC810\uC73C\uB85C \uC815\uC758\uB418\uACE0 \uC9C4\uD589\uB418\uC5B4 \uC785\uCD9C\uB825 \uD750\uB984\uC774 \uBA85\uD655\uD574\uC9C0\uACE0, \uCD94\uD6C4 \uAD6C\uC870 \uBCC0\uACBD\uC774\uB098 \uC18C\uC2A4 \uC218\uC815 \uC2DC \uAD6C\uC870\uC758 \uBE60\uB978 \uD30C\uC545\uACFC \uC218\uC815\uC774 \uAC00\uB2A5\uD568. \uC7AC\uC0AC\uC6A9 \uD14C\uC2A4\uD2B8 \uB610\uD55C \uC27D\uAC8C \uAC00\uB2A5</li></ul><blockquote><p>\uAE30\uC220\uC801 \uAD00\uC810\uC740 \uAE30\uB2A5 \uC790\uCCB4\uC758 \uC2E4\uD604\uC5D0 \uBAA9\uC801\uC744 \uB450\uAE30\uC5D0 \uCF54\uB4DC\uAC00 \uBCF5\uC7A1\uD574\uC9C0\uACE0 \uD14C\uC2A4\uD2B8\uAC00 \uC5B4\uB824\uC6CC\uC9D0</p></blockquote></li><li><p>\uD14C\uC2A4\uD2B8 \uBB38\uC11C \uB300\uCCB4 \uAC00\uB2A5</p><ul><li>\uD14C\uC2A4\uD305\uC758 \uC790\uB3D9\uD654\uB294 \uBB3C\uB860 \uC815\uD655\uD55C \uD14C\uC2A4\uD2B8 \uADFC\uAC70 \uC0B0\uCD9C \uAC00\uB2A5</li></ul></li></ul>',7),c=[s];function d(u,n){return l(),i("div",null,c)}var h=e(p,[["render",d],["__file","Overview.html.vue"]]);export{h as default};
